pub fn lookup_property(content: &str) -> Option<&'static [(u32, u32)]> {
    if let Some(eq_pos) = content.find('=') {
        let prop_name = &content[..eq_pos];
        let prop_value = &content[eq_pos + 1..];
        match prop_name {
            "Script" | "sc" => lookup_script(prop_value),
            "Script_Extensions" | "scx" => lookup_script_extensions(prop_value),
            "General_Category" | "gc" => lookup_gc(prop_value),
            _ => None,
        }
    } else {
        // Try binary property first, then lone GC value
        if let Some(r) = lookup_binary(content) {
            return Some(r);
        }
        lookup_gc(content)
    }
}

